fetch("https://api.themoviedb.org/3/trending/movie/week?api_key=d4703e60cf0d1782ebbe2f62ec94230a").then((e=>e.json())).then((e=>function(e){console.log(e),console.log("this is console");const t=document.getElementById("trending-body");t.innerHTML="",e.forEach((e=>{t.innerHTML+=`<div class="movie-card-${e.id} movie-card">\n            <div class="movie-image">\n                <img src="https://image.tmdb.org/t/p/w500${e.poster_path}" alt="${e.title}">\n                <div class="movie-title">\n                    ${e.title}\n                </div>\n            </div>\n        </div>\n        `}))}(e.results))).catch((e=>console.error("Error:",e)));